import React, { useEffect, useState } from 'react'

function App() {

  const [backEndData, setBackEndData] = useState([{}])

  useEffect(() => {
    fetch("/api")
      .then(response => response.json())
      .then(data => {setBackEndData(data)})
    }, [])

  return (

    <div>
      {backEndData.map(game => {
        <>
          <div>{game.id}</div>
          <div>{game.name}</div>
        </>
      })}
    </div>
  )
}

export default App
